import Items from "@/data/items";

class ItemService {

    getItems(){
        return Promise.resolve(Items);
    }

    addItem(item){
        Items.push(item);
        return Promise.resolve(item);
    }

    getItemTypes(){
        return Promise.resolve([{}, {}]);
    }
}

export default new ItemService();
